代码:
package com.github.ManagerBoss.DSIMC.common.item;

import net.minecraftforge.fml.common.registry.ForgeRegistries;

public class DSInMinecraftItems {
       public static void init() {
               ForgeRegistries.ITEMS.register(new ItemLog().setRegistryName("log"));
       }
}


版本：1.12.2

报错：没有为类型 ItemLog 定义方法 setRegistryName（String）

replies.txt_content:
1.
你确定你的 ItemLog 写对了？正确继承 net.minecraft.item.Item 类了吗？
你的类应该长这样：
public class ItemLog extends Item {
    // 省略一千字
}复制代码

2.
@Mod.EventBusSubsriber(modid = "mymodid")
public final class ItemLoader {

    // 你不需要手动调用此方法！
    @SubscribeEvent
    public static void registerItem(RegistryEvent.Register<Item> event) {
        event.getRegistry().register(new ItemLog().setRegistryName("log"));
    }

}复制代码
